import React from 'react';
import { Link } from 'react-router-dom';
import HeaderNoSearch from '../components/HeaderNoSearch';
import Footer from '../components/Footer';

function Explorer() {
  return (
    <div>
      <HeaderNoSearch title="Explorar" />
      <Link to="/explorar/comidas"><button type="button" data-testid="explore food">Explorar comidas</button></Link>
      <Link to="/explorar/bebidas"><button type="button" data-testid="explore drinks">Explorar bebidas</button></Link>
      <Footer />
    </div>
  );
}

export default Explorer;
